import { Link, useNavigate } from "react-router-dom";
import { useState } from "react";
import axios from "axios";
import "./Login.css";

function Login() {
	const navigate = useNavigate();
	const [formData, setFormData] = useState({
		email: "",
		password: ""
	});

	const handleChange = (e) => {
		setFormData({
			...formData,
			[e.target.name]: e.target.value
		});
	};

	const handleSubmit = async (e) => {
		e.preventDefault();
		try {
			// Add your login API call here
			console.log("Login data:", formData);
			// After successful login
			navigate("/");
		} catch (error) {
			console.error("Login error:", error);
		}
	};

	const googleAuth = () => {
		window.location.href = "http://localhost:5000/auth/google";
	};

	return (
		<div className="container">
			<h1 className="heading">Login Form</h1>
			<div className="form_container">
				<div className="left">
					<img className="img" src="./images/login.jpg" alt="login" />
				</div>
				<div className="right">
					<h2 className="from_heading">Login to Your Account</h2>
					<input type="text" className="input" placeholder="Email" name="email" value={formData.email} onChange={handleChange} />
					<input type="password" className="input" placeholder="Password" name="password" value={formData.password} onChange={handleChange} />
					<button className="btn" onClick={handleSubmit}>Log In</button>
					<p className="text">or</p>
					<button className="google_btn" onClick={googleAuth}>
						<img src="./images/google.png" alt="google icon" />
						<span>Sign in with Google</span>
					</button>
					<p className="text">
						Don't Have Account ? <Link to="/register">Sign Up</Link>
					</p>
				</div>
			</div>
		</div>
	);
}

export default Login;
